import React from 'react'
import ReactDOM from 'react-dom';

class Butao extends React.Component {
  constructor(props){
    super(props);
    this.state = {event}
    this.handleClick = this.handleClick.bind(this)
  }

  handleClick(e){
    console.log('Clicou')
    event = e
    this.setState({
      event
    });
  }
  render(){
    return (
      <button href='#' onClick={this.handleClick}>
        Click me
      </button>
    )
  }
}

ReactDOM.render(
  <Butao />,
  document.getElementById('root')
);
